import React from 'react'
import { AiOutlineStar ,AiFillStar} from 'react-icons/ai';


export default function star() {
    return (
        <div className="packStar">
            <AiFillStar/> <AiFillStar/> <AiFillStar/> <AiOutlineStar/> <AiOutlineStar/>
        </div>
    )
}
